import React, {Component} from 'react'


class BadRobot extends Component {

    render(){
        return(
            <div>
                <h1>Bad Robot</h1>
                <p>I hear you saying {this.props.convert(this.props.value)}</p>
            </div>
        )
    }
}
export default BadRobot
